if any of yall are confused:
In korean culture people around your age or born in the same part of the year as you are automatically considered friends therefore you can just call them by their name. but if the person is older (even by a few months) you call them hyung (or unnie if youre a girl) basically jungwoo and mark’s age aren’t close together at all but they decided to be friends because they like eachother that much lol and haechan lowkey wants to be friends with mark but mark is like nuh uh
hope this helps
